    const GalleryItem = () => {
        return services.categories.map((button, idx) => {
            return <GalleryItem key={idx} button={button} />
        });
    }

    return (
        <GalleryStyled className='Gallery'>
            {renderButtons()}
        </GalleryStyled>
    );
}

export default Gallery;

